package com.rockville.springpromethus;

import lombok.extern.slf4j.Slf4j;
import org.springframework.beans.factory.annotation.Value;
import org.springframework.boot.context.properties.ConfigurationProperties;
import org.springframework.cloud.context.config.annotation.RefreshScope;
import org.springframework.context.annotation.ComponentScan;
import org.springframework.context.annotation.Configuration;


@Configuration
@ConfigurationProperties(prefix = "bean")
@ComponentScan()
@Slf4j
@RefreshScope
public class Configs {

    private String message;

    @Value("${bean.message}")
    private String testMessage;

    public String getMessage() {
        return message;
    }

    public void setMessage(String message) {
        log.info("------------> SET MESSAGE : {}", message);
        this.message = message;
    }

    public String getTestMessage() {
        return testMessage;
    }

}
`
**The class using the configs** 
`@RestController
@Slf4j
@EnableScheduling
public class TestController {

    @Autowired
    private Configs configs;

    @GetMapping("/hello")
    public String sayHello() {
        log.info("--------> Hit received");
        return "Hello World Message : " + configs.getMessage();
    }

    @Scheduled(fixedDelay = 5000)
    public void schedule() {
        log.info("Current Message : {} test Message : {}", configs.getMessage(), configs.getTestMessage());
    }
}`
