e': None, 'comments': 1, 'created_at': '2022-02-18T16:51:01Z', 'updated_at': '2022-03-10T15:16:40Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**Describe the bug**
Versions :
Spring cloud 2021.0.0
Spring boot 2.6.3

Description:
I created a gateway project with resilience4j as CircuitBreaker to catch exceptions and return custom HTTP errors. I configured the timelimiter to provide a timeout after 60s. Everything works great with GET requests but with other HTTP methods (like POST or PUT), the CircuitBreaker fallback doesn't catch the exception and a 405 error is returned.
I use this circuitBreaker in combination of a discoveryLocator (sample below).

**Sample**
Config sample:
```yaml
spring:
  cloud:
    gateway:
      discovery:
        locator:
          enabled: true
          lower-case-service-id: true
          predicates:
            - name: Path
              args:
                pattern: "'/'+serviceId+'/**'"
          filters:
            - name: CircuitBreaker
              args:
                name: "'gatewayCircuitBreaker'"
                fallbackUri: "'forward:/fallback'"
            - name: RewritePath
              args:
                regexp: "'/' + serviceId + '/(?<remaining>.*)'"
                replacement: "'/${remaining}'"
```

CircuitBreakerFactory Bean:

```java
@Configuration
public class GatewayCircuitBreakerConfig {

    /**
     * Allows loading of circuitBreaker configuration from Spring yaml config
     */
    @Bean
    public ReactiveResilience4JCircuitBreakerFactory reactiveResilience4JCircuitBreakerFactory(CircuitBreakerRegistry circuitBreakerRegistry, TimeLimiterRegistry timeLimiterRegistry) {
        return new ReactiveResilience4JCircuitBreakerFactory(circuitBreakerRegistry, timeLimiterRegistry);
    }
}
```

Fallback controller:
```java
@Slf4j
@RestController
@RequestMapping("/fallback")
public class FallbackController {

    @GetMapping
    public ResponseEntity<String> getFallback(ServerWebExchange exchange) {
        Throwable cause = exchange.getAttribute(CIRCUITBREAKER_EXECUTION_EXCEPTION_ATTR);
        Throwable rootCause = ExceptionUtils.getRootCause(cause);
        log.debug("Failure, cause was : ", cause);

        if(rootCause == null && cause instanceof java.util.concurrent.TimeoutException) {
            // Gateway Timeout
            return buildGatewayTimeoutResponse();
        } else {
            // Other error
            return buildResponse(HttpStatus.INTERNAL_SERVER_ERROR, cause);
        }
    }
}
