> If a service needs to be accessed over HTTPS you need to add a label or annotation to your service definition with the name secured and the value true and the load balancer will then use HTTPS to make requests to the service.

Currently, if no `secured: true` label/annotation is found, it is using HTTP. For our services we sould like to have it vice versa.
 You need to explicitly opt-out via `secured: false` to use HTTP, otherwise if it's absent (or true) it will use HTTPS.

**Describe the solution you'd like**
Enhance the `KubernetesDiscoveryProperties` and provide a way to define the default value when `input.serviceLabels.getOrDefault("secured", "false");` and `input.serviceAnnotations.getOrDefault("secured", "false");`  is called  in `ServicePortSecureResolver`. The default value could be `false` to not interfere with any current implementations.

**Describe alternatives you've considered**
I don't see how I could achive it in any other way easily. I don't see how I could customize the `ServicePortSecureResolver` to add the required functionality. If you have any idea, I am happy to here it.', 'reactions': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-kubernetes/issues/976/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-kubernetes/issues/976/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-kubernetes/issues/comments/1064104848', 'html_url': 'https://github.com/spring-cloud/spring-cloud-kubernetes/issues/976#issuecomment-1064104848', 'issue_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-kubernetes/issues/976', 'id': 1064104848, 'node_id': 'IC_kwDOBI3HKs4_bPOQ', 'user': {'login': 'ryanjbaxter', 'id': 524254, 'node_id': 'MDQ6VXNlcjUyNDI1NA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/524254?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ryanjbaxter', 'html_url': 'https://github.com/ryanjbaxter', 'followers_url': 'https://api.github.com/users/ryanjbaxter/followers', 'following_url': 'https://api.github.com/users/ryanjbaxter/following{/other_user}', 'gists_url': 'https://api.github.com/users/ryanjbaxter/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ryanjbaxter/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ryanjbaxter/subscriptions', 'organizations_url': 'https://api.github.com/users/ryanjbaxter/orgs', 'repos_url': 'https://api.github.com/users/ryanjbaxter/repos', 'events_url': 'https://api.github.com/users/ryanjbaxter/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ryanjbaxter/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-10T14:11:12Z', 'updated_at': '2022-03-10T14:11:12Z', 'au