'comments': 12, 'created_at': '2019-07-31T14:23:30Z', 'updated_at': '2022-03-09T17:20:08Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Spring cloud version : Finchley.SR2
Spring boot version : 2.0.6.RELEASE

spring cloud config with jdbc backend does not return the property sources in correct order.

Consider following configuration

application.yml
key1 : val1
spring.profile: test
key2: val2

service.yml
key3: val3
spring.profile: test
key2:val2

With native or git backend if i try to fetch properties with profile test then the order of property source is 
1. service.yml - profile test
2. application.yml - profile test
3. service.yml - profile default
4. application.yml - profile default

But if i use jdbc as backend then format of returned property source is
1. service.yml - profile test
2. service.yml - profile default
3. application.yml - profile test
4. application.yml - profile default

What it does is when service is started it does not receive correct set of properties.

After looking at code in JdbcEnvironmentRepository, if the following for loop are switched (i.e loop through env and then application) it should fix the problem 
`for (String app : applications) {
			for (String env : envs) {
     }
}`
