: None, 'assignees': [], 'milestone': None, 'comments': 1, 'created_at': '2022-03-03T15:11:30Z', 'updated_at': '2022-03-08T00:48:08Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'Checked exceptions are not possible with the cbFactory.create("...").run( () -> ...) pattern. 
Sometimes this is needed, maybe because of generated code or older code, which would be hard to re-work. 

I want to replace @HystrixCommand (with supports checked exceptions) and have several methods with checked exceptions. 

I use it with R4J and there is a possibility going this style 

```
    public BerichtsdatenResponse kontrollberichtUebertragen(Bericht bericht) throws Fehler_Exception {

        CircuitBreakerTemplate<BerichtsdatenResponse, Fehler_Exception> template =
            new CircuitBreakerTemplate<>("scowi-kb", Fehler_Exception.class);
        return template.circuitBreak(() -> getBerichtUebertragenResponse(bericht));
    }
```
using this self written template
```
    @SuppressWarnings("unchecked")
    public R circuitBreak(CheckedFunction0<R> supplier) throws E {
        var checkedSupplier = CircuitBreaker.decorateCheckedSupplier(circuitBreaker, supplier);

        Try<R> responseTry = Try.of(checkedSupplier);
        if (responseTry.isFailure()) {
            throw (E) responseTry.getCause();
        }
        return responseTry.get();
    }
```
Your run() used only 
`return Try.of(callable::call).recover(fallback).get();`

Do you see a way for a workaround right now? 

Suggest to add another run method making handling of checked exceptions straightforward.', 'reactions': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/143/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/143/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/comments/1061292395', 'html_url': 'https://github.com/spring-cloud/spring-cloud-circuitbreaker/issues/143#issuecomment-1061292395', 'issue_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/143', 'id': 1061292395, 'node_id': 'IC_kwDOCWReK84_Qglr', 'user': {'login': 'ryanjbaxter', 'id': 524254, 'node_id': 'MDQ6VXNlcjUyNDI1NA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/524254?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ryanjbaxter', 'html_url': 'https://github.com/ryanjbaxter', 'followers_url': 'https://api.github.com/users/ryanjbaxter/followers', 'following_url': 'https://api.github.com/users/ryanjbaxter/following{/other_user}', 'gists_url': 'https://api.github.com/users/ryanjbaxter/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ryanjbaxter/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ryanjbaxter/subscriptions', 'organizations_url': 'https://api.github.com/users/ryanjbaxter/orgs', 'repos_url': 'https://api.github.com/users/ryanjbaxter/repos', 'events_url': 'https://api.github.com/users/ryanjbaxter/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ryanjbaxter/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-08T00:48:07Z', 'updated_at': '2022-03-08T00:48:07Z', 'author_association': 'COLLABORATOR', 'body': 'Sorry I am not following, can you provide and exampl