g isn't working"}], 'state': 'closed', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/milestones/12', 'html_url': 'https://github.com/spring-cloud/spring-cloud-circuitbreaker/milestone/12', 'labels_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/milestones/12/labels', 'id': 7661739, 'node_id': 'MI_kwDOCWReK84AdOir', 'number': 12, 'title': '2.1.1', 'description': None, 'creator': {'login': 'ryanjbaxter', 'id': 524254, 'node_id': 'MDQ6VXNlcjUyNDI1NA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/524254?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ryanjbaxter', 'html_url': 'https://github.com/ryanjbaxter', 'followers_url': 'https://api.github.com/users/ryanjbaxter/followers', 'following_url': 'https://api.github.com/users/ryanjbaxter/following{/other_user}', 'gists_url': 'https://api.github.com/users/ryanjbaxter/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ryanjbaxter/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ryanjbaxter/subscriptions', 'organizations_url': 'https://api.github.com/users/ryanjbaxter/orgs', 'repos_url': 'https://api.github.com/users/ryanjbaxter/repos', 'events_url': 'https://api.github.com/users/ryanjbaxter/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ryanjbaxter/received_events', 'type': 'User', 'site_admin': False}, 'open_issues': 0, 'closed_issues': 3, 'state': 'closed', 'created_at': '2022-02-10T00:49:09Z', 'updated_at': '2022-02-17T16:58:42Z', 'due_on': None, 'closed_at': '2022-02-17T16:58:42Z'}, 'comments': 9, 'created_at': '2021-11-05T12:55:18Z', 'updated_at': '2022-03-07T16:22:05Z', 'closed_at': '2022-02-10T00:54:54Z', 'author_association': 'NONE', 'active_lock_reason': None, 'body': '**How to reproduce**
1. use two different circuit breaker (CB) instances (`cb1`, `cb2`)
2. define `resilience4j.thread-pool-bulkhead.configs.default.coreThreadPoolSiz: 5`
3. define custom config for only one CB instance `resilience4j.thread-pool-bulkhead.instances.cb2.coreThreadPoolSize: 10`
4. you will not see metrics for `cb1` (e.g. `resilience4j.bulkhead.max.thread.pool.size`) at /prometheus but /metrics is fine

**Explanation**
Prometheus requires that all meters with the same name have the same set of tag keys. See: https://github.com/micrometer-metrics/micrometer/issues/877
When we define custom config for circuit breaker, Spring Cloud Circuit Breaker (SCCB) will initialize CB instance at startup and this automatically register metric in Micrometer without any tags.
At runtime, for all CB instances, SCCB executes `Resilience4jBulkheadProvider.run()` and initializes other CB using `group` tag. See: https://github.com/spring-cloud/spring-cloud-circuitbreaker/blob/72868b72448d8bf072f168093b6bdadec609d9c7/spring-cloud-circuitbreaker-resilience4j/src/main/java/org/springframework/cloud/circuitbreaker/resilience4j/Resilience4JCircuitBreaker.java#L107
The result is that Prometheus will ignore metrics for `cb1`.

**Workaround**
Remove `group` tag in your code:
```java
@Bean
public MeterFilter removeGroupTagFromResilience4jBulkheadMeterFilter() {
	return new MeterFilter() {
		@Override
		public Meter.Id map(Meter.Id id) {
			if(id.getName().startsWith("resilience4j.bulkhead")) {
				List<Tag> tags = id.getTags().stream().filter(t -> !"group".equals(t.getKey())).collect(Collectors.toList());
				return id.replaceTags(tags);
			}
		   return id;
		}
	};
}
```

**Proposed fix**
Do not pass `group` tag to `Resilience4jBulkheadProvider`. Do we really need group as tag? Looks like the same value is used as name tag (created from `id`).', 'reactions': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/121/reactions', 'total_count': 1, '+1': 1, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/121/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/comments/1060873555', 'html_url': 'https://github.com/spring-cloud/spring-cloud-circuitbreaker/issues/121#issuecomment-1060873555', 'issue_url': 'https://api.github.com/repos/spring-cloud/spring-cloud-circuitbreaker/issues/121', 'id': 1060873555, 'node_id': 'IC_kwDOCWReK84_O6VT', 'user': {'login': 'ryanjbaxter', 'id': 524254, 'node_id': 'MDQ6VXNlcjUyNDI1NA==', 'avatar_url': 'https://avatars.githubusercontent.com/u/524254?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/ryanjbaxter', 'html_url': 'https://github.com/ryanjbaxter', 'followers_url': 'https://api.github.com/users/ryanjbaxter/followers', 'following_url': 'https://api.github.com/users/ryanjbaxter/following{/other_user}', 'gists_url': 'https://api.github.com/users/ryanjbaxter/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/ryanjbaxter/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/ryanjbaxter/subscriptions', 'organizations_url': 'https://api.github.com/users/ryanjbaxter/orgs', 'repos_url': 'https://api.github.com/users/ryanjbaxter/repos', 'events_url': 'https://api.github.com/users/ryanjbaxter/events{/privacy}', 'received_events_url': 'https://api.github.com/users/ryanjbaxter/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-07T16:22:05Z', 'updated_at': '2022-03-07T16:22:05Z', 'author_association': 'COLLABO