In this one, I already deployed the Spring Cloud Kuberneted DiscoveryServer using the yaml published in the [documentation page](https://docs.spring.io/spring-cloud-kubernetes/docs/current/reference/html/#deployment-yaml-3) (and using 2.1.1 version).

In the [discovery client documentation](https://docs.spring.io/spring-cloud-kubernetes/docs/current/reference/html/#discoveryclient-for-kubernetes) is told that:

> Spring Cloud Kubernetes can also watch the Kubernetes service catalog for changes and update the DiscoveryClient implementation accordingly. In order to enable this functionality you need to add @EnableScheduling on a configuration class in your application.

I did that:

    @SpringBootApplication
    @EnableDiscoveryClient
    @EnableScheduling
    public class GatewayApplication {

But when a new microservice is published in the cluster, it not catched in the routing tables.
We managed to inspect what is read by the discovery client in the gateway by developing an additional RestController that inquiries the server through the ReactiveDiscoveryClient, like this:

    @RestController
    public class GatewayController {
    
        @Autowired
        private ReactiveDiscoveryClient client;
        
        @GetMapping("/services")
        public ResponseEntity<Mono<List<String>>> getServices() {
            try {
                return ResponseEntity.ok(this.client.getServices().collectList());
            } catch (Exception ex) {
                return ResponseEntity.internalServerError().build();
            }
        }
    }

Opening the browser on localhost:8080/services, the whole list is given, even the "new" services (the ones that has been started AFTER the gateway).
Restarting the gateway application (i.e. kubectl delete and apply) all the cluster services are reachable, meaning that che routing tables is fully populated.

I saw that in the old version (1.1.x) there was a KubernetesCatalogWatch, triggered by KubernetesCatalogWatchAutoConfiguration (and the relative yaml property, spring.cloud.kubernetes.discovery.catalog-services-watch.enabled, true by default), that had a @Scheduled method for catalg update. In the current version there is nothing similar: is the documentation still valid or there is another way to activate the automatic service discovery update?

Thanks in advance
